import React, {Component} from 'react';
import raTeam from './raTeam.json';
import rsTeam from './rsTeam.json';

import TeamMembercard from "./../teamMemberCard/teamMemberCard";

import './../../css/RA-1.css'


export default class TeamList extends Component {

    constructor(props) {
        super();
        this.state = {
            teamName : "",
            teamMembers :[],
            activeTeamMember : ""
        }
    }


    componentDidMount() {
        if(this.props.teamName === "RA") {
            let res = raTeam;
            this.setState({teamName : res.teamName});
            this.setState({teamMembers : res.members});
        }
        else if(this.props.teamName === "RS") {
            let res = rsTeam;
            this.setState({teamName : res.teamName});
            this.setState({teamMembers : res.members});
        }
        else {
            let res = {};
            this.setState({teamName : res.teamName});
            this.setState({teamMembers : res.members});
        }

    }

    displayTeamMemberInfo = () => {

    }

    render() {

        return(
            <div className="container-fluid">
                <div>
                    <button className="btn btn-primary">back</button>
                </div>
                <h1 id="text-danger">{this.state.teamName}</h1>
                    <div className="container">
                        <div className="row justify-content-center">
                            {
                                this.state.teamMembers.map(member => 
                                    <TeamMembercard key={member.member_id} teamMember={member} className="profile col-lg-4 col-md-6 col-sm-6 col-8" />
                                )
                            }
                        </div> 
                    </div>
            </div>
        ); 
    }
}
